    const [resim,setResim]=useState([])

    useEffect(()=>{
        axios.get(Url)
        .then(response=>{
            setResim(response.data)
        })
    },[key])

    console.log(resim,"resim");
  return (
   <>
  <h3>Unsplash Resim</h3>
  {
    resim.map((resim,i)=>
    <img key={i} src={resim.user.profile_image.small} />
    )
  }
   </>
  )
}

export default Home;
